    //     email:  PropTypes.string.isRequired,
    //     phone:  PropTypes.string.isRequired
    // }

    render() {
        const {name,email,phone}    =   this.props;
        return (
            <div>
                <h4>{name}</h4>
                <ul>
                    <li>{email}</li>
                    <li>{phone} </li>
                </ul>
            </div>
        )
    }
}

